    <style>
svg {
  width: 40%;
overflow: visible;
}

@keyframes star_boner {
  from { transform: scale(0); }
  to   { transform: scale(1); }
}

@keyframes flare_spin {
  from { transform: rotate(0deg);  }
  to   { transform: rotate(360deg); }
}

@keyframes text_pulse {
  0%   { transform: scale(0.7);  opacity: 0;  }
  50%  { transform: scale(1.10); opacity: 1; }
  100% { transform: sclae(1.0);  opacity: 1; }
}


.logo_stars {
  animation-duration: 1000ms;
  transform-origin: center;
  animation-play-state: paused;
  animation-timing-function: ease-in-out;
  animation-name: star_boner;
  animation-fill-mode: forwards;

  /* remove these later */
  animation-direction: alternate;
  animation-iteration-count: infinite;
  animation-direction: alternate;
  animation-iteration-count: 1;
}

#ytmnd_logo {
animation-duration: 1200ms;
animation-name: text_pulse;
transform-box: fill-box;
animation-timing-function: linear;
transform-origin: center;
animation-play-state: running;
animation-iteration-count: 1;
}

/* ids in case we need them */

#star_1_s, #star_2_s, #star_3_s, #star_4_s, #star_5_s, #star_6_s, #star_7_s, #star_8_s, #star_9_s, #star_10_s, #star_11_s, #star_12_s, #star_13_s, #star_14_m, #star_15_m, #star_16_m, #star_17_m, #star_18_m, #star_19_m, #star_20_m, #star_21_m, #star_22_m, #star_23_m, #star_24_l, #star_25_l, #star_26_s_notrail, #star_27_s_notrail,#star_28_s_notrail,#star_29_s_notrail   {
}

   /* initial state */

   .logo_stars {
     transform: scale(0);
   }

   #flare_top, #flare_bottom {
    animation-duration: 5000ms;
    animation-name: flare_spin;
    transform-box: fill-box;
    animation-timing-function: linear;
    transform-origin: center;
    animation-play-state: paused;
    animation-iteration-count: infinite;
    display: none;
   }
</style>
<script>
    var global_percent = 0;

    $(document).ready(function(){

    var anim_length = 1000;

    var star_animation_timing = {
      flare_bottom: 88,
      flare_top: 80,
      star_1_s: 66,
      star_2_s: 51,
      star_3_s: 68,
      star_4_s: 25,
      star_5_s: 43,
      star_6_s: 55,
      star_7_s: 64,
      star_8_s: 86,
      star_10_s: 67,
      star_11_s: 22,
star_12_s: 49,
star_13_s: 57,
star_14_m: 27,
star_15_m: 39,
star_16_m: 70,
star_17_m: 33,
star_18_m: 53,
star_19_m: 75,
star_20_m: 82,
star_21_m: 63,
star_22_m: 35,
star_23_m: 19,
star_24_l: 57,
star_25_l: 43,
star_26_s_notrail: 54,
star_27_s_notrail: 78,
star_28_s_notrail: 52,
star_29_s_notrail: 64,
};



    // getBBox for flare center offsets
    var flare_top = document.getElementById('flare_top');
    console.max(flare_top);

//    var bbox = flare_top.getBBox();
    //$('#flare_top').css('transofrm-origin', (bbox.x + (bbox.width/2)) + 'px ' + (bbox.y + (bbox.height/2)) + 'px');

    
    
    
    

    var percentage = 0;
    var anim_timer = null;

    var animation_cycler = function () {

      if (percentage < global_percent) {
        for (var id in star_animation_timing) {
          if (star_animation_timing[id] <= global_percent) {
            $('#' + id).css('animation-play-state', 'running');
          }
          percentage = global_percent;
        }
      }
      else if (percentage >= 100) {
        //$('.logo_stars').css('animation-play-state', 'paused');
        $('#flare_top, #flare_bottom').show();
        clearInterval(anim_timer);
      }
    }

    anim_timer = setInterval(animation_cycler, 100);


    setInterval(function(){
        global_percent += 5;

        if (global_percent > 100) {
          global_percent = 100;
        }

        $('#percentage').html(global_percent);
      }, 250);
    });



</script>
